import axios from "axios";
import React, { useState, useEffect } from "react";
function NewsStore() {
  const [news, setNews] = useState([]);
  useEffect(() => {
    const getNews = async () => {
      axios.get('https://newsapi.org/v2/everything?q=Apple&from=2025-01-11&sortBy=popularity&apiKey=298c073505384b2e83d1dc1c3aa3d032').then(res => {
        setNews(res.data.articles);
        console.log(res.data.articles);
      });
    }
    getNews();
  });
  return (
    <>
      <div>
        <h1>Latest News</h1>
        {
          news.map(article =>
            <div key={article.title}>
              <h3>{article.title}</h3>
              <p>{article.description}</p>
            </div>
          )
        }
      </div>
    </>
  );
}
export default NewsStore;
